            <div>
            <div className="text-2xl cursor-pointer reletive flex justify-center" onClick={()=>setMenuDisplay(preve => !preve)}>
              {user?.profilePic ? (
                <img
                  src={user.profilePic}
                  className="w-10 h-10 rounded-full"
                  alt={user?.name}
                />
              ) : (
                <FaRegUserCircle />
              )}
            </div>
            </div>
        </aside>

        <main>
               main
        </main>
    </div>
  )
}

